import React,{Component} from 'react';
import "semantic-ui-css/semantic.min.css";
import{
  List,
  Loader,
  Dimmer,
  Placeholder,
  Segment,
  Grid,
  Divider
}from "semantic-ui-react"

class App extends Component() {
  render(){
    return (
      <div>
        <Segment>
          <Grid columns={2} stackable textAlign="center">
            <Grid.Row verticalAlign="middle">
              <Grid.Column>
                satu
              </Grid.Column>
              <Grid.Column>
                dua
              </Grid.Column>
            </Grid.Row>
          </Grid>
        </Segment>
      </div>
    );
  }
}

export default App;
